DROP TABLE IF EXISTS `articles`;
CREATE TABLE `articles` (
  `id_article` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `article_category_id` int(11) unsigned DEFAULT NULL,
  `title` varchar(50) DEFAULT NULL,
  `article` text,
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `social` tinyint(1) unsigned NOT NULL,
  PRIMARY KEY (`id_article`),
  KEY `fk__article__article_category` (`article_category_id`),
  CONSTRAINT `articles_ibfk_1` FOREIGN KEY (`article_category_id`) REFERENCES `articles_category` (`id_article_category`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=78 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Records of `articles`
-- ----------------------------
BEGIN;
INSERT INTO `articles` VALUES ('67', '1', 'Préambule', 'Un petit texte de préambule pour expliquer le début de la quête.', '1', '0'), ('69', '3', 'Retrouvez mon ami des lamentations', ' Bonjour {{joueur}},<br />\n<br />\nJe suis à la recherche de mon ami qui vit dans la grotte des lamentations. Peux-tu essayer de le trouver?<br type=\"_moz\" />', '1', '0'), ('70', '3', 'Tu es un ami de mon ami Chapelle ?', ' Bonjour {{joueur}},<br />\n<br />\nDonc tu viens de la part de mon ami? Comment va-t-il ? Dans tous les cas, ça fait plaisir que tu viens me passer son bonjour.<br type=\"_moz\" />', '1', '0'), ('71', '3', 'Aide pour la grotte des lamentations', ' Plus tu iras dans l\'obscurité, plus tu auras de chance de trouver mon ami.', '1', '0'), ('72', '3', 'J\'ai une soif de loup', ' J\'ai vraiment soif! Peux tu me trouver un truc à boire? En échange je te donnerai une quête à faire. Elle te permettra d\'aller dans le village à coté.', '1', '0'), ('73', '3', 'Mais ou est le dealer du grenier', ' Pour trouver le dealer du grenier, tu devras te rendre dans une maison du village. Comme tu as dut le comprendre, il se trouve dans un des greniers.', '1', '0'), ('74', '3', 'Ca fait du bien de boire un peu', ' Merci pour ce coup de main. Ca fait un moment que j\'ai pas bu un truc. Reviens me voir si tu as besoin d\'une quête qui te sera utile.', '1', '0'), ('75', '3', 'Le seigneur de murs', ' Tiens te revoilà,<br />\n<br />\nSi tu souhaites aller dans le village voisin, je t\'invite à aller le seigneur des murs qui te donnera l\'accès au village.<br />\nLe connaissant, je t\'invite à le trouver caché dans la maison du seigneur. Mais n\'y va pas les main vide car il te fera jamais passer si tu n\'as pas ton épée.<br />\nTu dois donc trouver l\'épée avant de t\'y rendre.<br type=\"_moz\" />', '1', '0'), ('76', '3', 'L\'épée du héro', ' L\'épée du héro se cache derrière une cheminée, celle de Sam, un sacré cachotier qui d\'ailleurs à fait en sorte d\'y accéder que par un seul chemin tel un singe dans un arbre.<br />\nTu reconnaitra sa maison car c\'est la seule qui à une poutre apparente sur sa devanture.', '1', '0'), ('77', '3', 'Présentation avec le seigneur des murs', ' Bonjour {{joueur}},<br />\nJe vois que tu viens de la grotte et que tu as déjà ton épée de héro. Félicitation car rare sont ceux qui l\'ont trouvé.<br />\nSi tu souhaites aller dans l\'autre village, il te suffit de passer entre les 2 tas de terre qui se trouve à droite de la maison.', '1', '0');
COMMIT;

