DROP TABLE IF EXISTS `bots`;
CREATE TABLE `bots` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `x` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `y` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `z` tinyint(3) unsigned DEFAULT '0',
  `region_id` int(11) unsigned DEFAULT '0',
  `user_id` int(11) unsigned DEFAULT NULL,
  `image` varchar(255) DEFAULT NULL,
  `argent` int(11) unsigned NOT NULL DEFAULT '0',
  `xp` int(11) unsigned NOT NULL DEFAULT '0',
  `niveau` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `hp_max` int(11) unsigned NOT NULL DEFAULT '0',
  `hp` int(11) unsigned NOT NULL DEFAULT '0',
  `mp_max` int(11) unsigned NOT NULL DEFAULT '0',
  `mp` int(11) unsigned NOT NULL DEFAULT '0',
  `sorts` varchar(255) DEFAULT NULL,
  `attaque` smallint(4) unsigned NOT NULL DEFAULT '0',
  `defense` smallint(4) unsigned NOT NULL DEFAULT '0',
  `module` int(11) unsigned NOT NULL DEFAULT '0',
  `item_id_handLeft` int(11) unsigned DEFAULT '0',
  `item_id_handRight` int(11) unsigned DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `x` (`x`),
  KEY `y` (`y`),
  KEY `region_id` (`region_id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `bots_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `bots_ibfk_2` FOREIGN KEY (`region_id`) REFERENCES `regions` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

